var flowFile = session.get();
if (flowFile != null) {

  var todayTimeStamp = +new Date;
var oneDayTimeStamp = 1000 * 60 * 60 * 24;
var diff = todayTimeStamp - oneDayTimeStamp;
var yesterdayDate = new Date(diff);
var date = yesterdayDate.getDate();
var month = yesterdayDate.getMonth();
var year = yesterdayDate.getFullYear();
var minTime = new Date(year,month,date);

flowFile = session.putAttribute(flowFile, 'startTime',minTime.getTime());
session.transfer(flowFile, REL_SUCCESS);
}

var flowFile = session.get();
if (flowFile != null) {
var todayTimeStamp = +new Date;
var oneDayTimeStamp = 1000 * 60 * 60 * 24 * 1;
var diff = todayTimeStamp - oneDayTimeStamp;
var myDate = new Date(diff);
var year = new Date().getFullYear().toString().substr(-2);
var onejan = new Date(myDate.getFullYear(), 0, 1);
 var weekofyear=Math.ceil((((myDate - onejan) / 86400000) + onejan.getDay() ) / 7);
var weekofyearStr=String(weekofyear);
if(weekofyearStr.length==1){weekofyearStr='0'+weekofyearStr;
}
weekofyearStr=year+weekofyearStr;
flowFile = session.putAttribute(flowFile, 'week', weekofyearStr);
session.transfer(flowFile, REL_SUCCESS);
}

